const e=JSON.parse('{"key":"v-d1d1d3cc","path":"/blog/old/beframework/rabbitmq/rabbitmq.html","title":"RabbitMQ使用指南","lang":"zh-CN","frontmatter":{"title":"RabbitMQ使用指南","sidebar":"heading","category":["后端框架","RabbitMQ"],"tag":["RabbitMQ"],"description":"前置概念了解： 什么是AMQP 和 JMS？ AMQP：即Advanced Message Queuing Protocol，是一个应用层标准高级消息队列协议，提供统一消息服务。是应用层协议的一个开放标准，为面向消息的中间件设计。基于此协议的客户端与消息中间件可传递消息，并不受客户端/中间件不同产品，不同的开发语言等条件的限制。Erlang中的实现有RabbitMQ等。 JMS：即Java消息服务（Java Message Service）应用程序接口，由sun公司提出，并且sun公司定义好了接口。包括create、send、recieve。只要想使用它，就得实现它定义的接口。 消息服务是一个与具体平台无关的API，绝大多数MOM提供商都对JMS提供支持。不好的地方是语言层面的限制，只能为JAVA，这其实稍微有点和微服务的观点相违背。要求语言只能是JAVA，而不能是py等。","head":[["meta",{"property":"og:url","content":"https://alooc.github.io/blog/old/beframework/rabbitmq/rabbitmq.html"}],["meta",{"property":"og:site_name","content":"Alooc"}],["meta",{"property":"og:title","content":"RabbitMQ使用指南"}],["meta",{"property":"og:description","content":"前置概念了解： 什么是AMQP 和 JMS？ AMQP：即Advanced Message Queuing Protocol，是一个应用层标准高级消息队列协议，提供统一消息服务。是应用层协议的一个开放标准，为面向消息的中间件设计。基于此协议的客户端与消息中间件可传递消息，并不受客户端/中间件不同产品，不同的开发语言等条件的限制。Erlang中的实现有RabbitMQ等。 JMS：即Java消息服务（Java Message Service）应用程序接口，由sun公司提出，并且sun公司定义好了接口。包括create、send、recieve。只要想使用它，就得实现它定义的接口。 消息服务是一个与具体平台无关的API，绝大多数MOM提供商都对JMS提供支持。不好的地方是语言层面的限制，只能为JAVA，这其实稍微有点和微服务的观点相违背。要求语言只能是JAVA，而不能是py等。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2024-04-22T01:58:54.000Z"}],["meta",{"property":"article:author","content":"Alooc"}],["meta",{"property":"article:tag","content":"RabbitMQ"}],["meta",{"property":"article:modified_time","content":"2024-04-22T01:58:54.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"RabbitMQ使用指南\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2024-04-22T01:58:54.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Alooc\\",\\"url\\":\\"https://alooc.github.io\\"}]}"]]},"headers":[{"level":3,"title":"什么是AMQP 和 JMS？","slug":"什么是amqp-和-jms","link":"#什么是amqp-和-jms","children":[]},{"level":3,"title":"常见的MQ产品","slug":"常见的mq产品","link":"#常见的mq产品","children":[]},{"level":2,"title":"1、简单模式","slug":"_1、简单模式","link":"#_1、简单模式","children":[]},{"level":2,"title":"2、工作模式","slug":"_2、工作模式","link":"#_2、工作模式","children":[]},{"level":2,"title":"3、发布/订阅模式","slug":"_3、发布-订阅模式","link":"#_3、发布-订阅模式","children":[]},{"level":2,"title":"4、路由模式","slug":"_4、路由模式","link":"#_4、路由模式","children":[]},{"level":2,"title":"5、通配符模式","slug":"_5、通配符模式","link":"#_5、通配符模式","children":[]}],"git":{"createdTime":1713751134000,"updatedTime":1713751134000,"contributors":[{"name":"dongzhaohe","email":"dongzhaohe@credamo.com","commits":1}]},"readingTime":{"minutes":2.56,"words":768},"filePathRelative":"blog/old/beframework/rabbitmq/rabbitmq.md","localizedDate":"2024年4月22日","excerpt":"<h1> 前置概念了解：</h1>\\n<h3> 什么是AMQP 和 JMS？</h3>\\n<p><strong>AMQP</strong>：即Advanced Message Queuing Protocol，是一个应用层标准高级消息队列协议，提供统一消息服务。是应用层协议的一个开放标准，为面向消息的中间件设计。基于此协议的客户端与消息中间件可传递消息，并不受客户端/中间件不同产品，不同的开发语言等条件的限制。<strong>Erlang中的实现有RabbitMQ</strong>等。</p>\\n<p><strong>JMS</strong>：即Java消息服务（Java Message Service）<strong>应用程序接口</strong>，由sun公司提出，并且sun公司定义好了接口。包括create、send、recieve。只要想使用它，就得实现它定义的接口。 消息服务是一个与具体平台无关的API，绝大多数MOM提供商都对JMS提供支持。不好的地方是语言层面的限制，只能为JAVA，这其实稍微有点和微服务的观点相违背。要求语言只能是JAVA，而不能是py等。</p>","autoDesc":true}');export{e as data};
